import React, { useEffect } from "react";
import Container from '@material-ui/core/Container';
import { Grid } from "@material-ui/core";
import "../css/homepage.css";
import { connect } from 'react-redux';
import { AddList } from '../actions/homepageActions';

const Homepage = () => {
    useEffect(() => {
        let images = [
            { icon: "fa-baseball-ball", color: "" },
            { icon: "fa-bug", color: "" },
            { icon: "fa-bullseye", color: "" },
            { icon: "fa-burn", color: "" },
            { icon: "fa-camera-retro", color: "" },
            { icon: "fa-car", color: "" },
            { icon: "fa-cat", color: "" },
            { icon: "fa-chess", color: "" },
            { icon: "fa-chess-queen", color: "" },
            { icon: "fa-compact-disc", color: "" },
            { icon: "fa-dove", color: "" },
            { icon: "fa-dragon", color: "" },
            { icon: "fa-gopuram", color: "" },
            { icon: "fa-heartbeat", color: "" },
            { icon: "fa-igloo", color: "" },
        ]
    }, [])
    return (
        <React.Fragment>
            <div className="main_heading">CARD MEMORY GAME</div>
            <Container maxWidth="xl">
                <Grid container spacing={4}>
                    <Grid item xs={4} sm={4} md={3} lg={2} xl={2}>
                        <div className="card_container">
                        </div>
                    </Grid>
                    <Grid item xs={4} sm={4} md={3} lg={2} xl={2}>
                    </Grid>
                    <Grid item xs={4} sm={4} md={3} lg={2} xl={2}>
                    </Grid>
                    <Grid item xs={4} sm={4} md={3} lg={2} xl={2}>
                    </Grid>
                </Grid>
            </Container>
        </React.Fragment>
    )
}

const mapStateToProps = state => ({
    list: state.list
})

const mapDispatchToProps = dispatch => ({
    AddList: (data) => dispatch(AddList(data))
})

export default connect(mapStateToProps, mapDispatchToProps)(Homepage);
